import React from 'react'

const MyAccount = () => {
  return (
    <div className='bg-light'>
       <div className='d-flex'>
          <p className='text-primary'>Appointment Status</p>
          <button className='btn btn-primary'>Edit details</button>
       </div>
    </div>
  )
}

export default MyAccount
